/*

WARNING DESTRUCTIVE

This will completely destroy the current "Library Management" schema and replace it.

*/
DROP SCHEMA "Library Management" CASCADE;
CREATE SCHEMA "Library Management";


-- Authors

CREATE TABLE "Library Management"."Authors" (
    id integer NOT NULL,
    "First Name" text,
    "Last Name" text,
    "Website" mathesar_types.uri
);

CREATE SEQUENCE "Library Management"."Authors_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Library Management"."Authors_id_seq" OWNED BY "Library Management"."Authors".id;


-- Books

CREATE TABLE "Library Management"."Books" (
    id integer NOT NULL,
    "Title" text,
    "Publication Year" integer,
    "Media" text,
    "Page Count" integer,
    "Languages" text,
    "LC Classification" text,
    "ISBN" text,
    "Dewey Decimal" text,
    "Dewey Wording" text,
    "Author" integer,
    "Publisher" integer
);

CREATE SEQUENCE "Library Management"."Books_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Library Management"."Books_id_seq" OWNED BY "Library Management"."Books".id;


-- Checkouts

CREATE TABLE "Library Management"."Checkouts" (
    id integer NOT NULL,
    "Item" integer,
    "Patron" integer,
    "Checkout Time" timestamp without time zone NOT NULL,
    "Due Date" date NOT NULL,
    "Check In Time" timestamp without time zone
);

CREATE SEQUENCE "Library Management"."Checkouts_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Library Management"."Checkouts_id_seq" OWNED BY "Library Management"."Checkouts".id;


-- Items

CREATE TABLE "Library Management"."Items" (
    id integer NOT NULL,
    "Barcode" text,
    "Acquisition Date" date,
    "Acquisition Price" mathesar_types.mathesar_money,
    "Publication" integer
);

CREATE SEQUENCE "Library Management"."Items_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Library Management"."Items_id_seq" OWNED BY "Library Management"."Items".id;


-- Patrons

CREATE TABLE "Library Management"."Patrons" (
    id integer NOT NULL,
    "First Name" text,
    "Last Name" text,
    "Email" mathesar_types.email
);

CREATE SEQUENCE "Library Management"."Patrons_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Library Management"."Patrons_id_seq" OWNED BY "Library Management"."Patrons".id;


-- Publishers

CREATE TABLE "Library Management"."Publishers" (
    id integer NOT NULL,
    "Name" text
);

CREATE SEQUENCE "Library Management"."Publishers_id_seq"
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE "Library Management"."Publishers_id_seq" OWNED BY "Library Management"."Publishers".id;


-- Set sequential defaults
ALTER TABLE ONLY "Library Management"."Authors"
  ALTER COLUMN id SET DEFAULT nextval('"Library Management"."Authors_id_seq"'::regclass);
ALTER TABLE ONLY "Library Management"."Books"
  ALTER COLUMN id SET DEFAULT nextval('"Library Management"."Books_id_seq"'::regclass);
ALTER TABLE ONLY "Library Management"."Checkouts"
  ALTER COLUMN id SET DEFAULT nextval('"Library Management"."Checkouts_id_seq"'::regclass);
ALTER TABLE ONLY "Library Management"."Items"
  ALTER COLUMN id SET DEFAULT nextval('"Library Management"."Items_id_seq"'::regclass);
ALTER TABLE ONLY "Library Management"."Patrons"
  ALTER COLUMN id SET DEFAULT nextval('"Library Management"."Patrons_id_seq"'::regclass);
ALTER TABLE ONLY "Library Management"."Publishers"
  ALTER COLUMN id SET DEFAULT nextval('"Library Management"."Publishers_id_seq"'::regclass);


